import React from "react";
import {BrowserRouter as Router, Link, Routes} from 'react-router-dom'
import NavBar from "./components/NavBar";
function App() {
  return (
   <div>
    <Router>
      <Routes>
        <NavBar/>
      </Routes>
    </Router>
   </div>
  );
}

export default App;
